import { Component } from 'react';
import './App.css';
import { gsap, InertiaPlugin, Draggable, TextPlugin } from "gsap/all";

class HomePage extends Component {
  componentDidMount() {
    gsap.registerPlugin(Draggable, InertiaPlugin, TextPlugin);

    Draggable.create(".draggable", {
      bounds: ".container",
      inertia: true,
      onClick: (e) => {
        console.log('CLICKED', e.target)
        // e.target.style.backgroundColor= 'blue'
    }});

    Draggable.create(".rotation", {
      type: "rotation",
      inertia: true,
      onClick: (e) => {
        console.log('CLICKED', e.target)
        // e.target.style.backgroundColor= 'blue'
    }});

     gsap.to(".title-home", {
        duration: 3,
        text: "Jade & Seka",
        ease: "power1.out",
    });
  }

  render() {
    return (
      <>
        <div className='container'>
            <h2 className="cedarville-cursive-regular title-home"> </h2>
        </div>
        <div>
            <img src={require('./sd_card.png')} alt='sd_card' className="draggable image-context" />
            <img src={require('./cup.png')} alt='sd_card' className="draggable image-context cup" />
            <img src={require('./champagne-glass.png')} alt='sd_card' className="rotation image-context" />
        </div>
      </>
    );
  }
}


export default HomePage;
